pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract EventRevised  {
    enum eventStage {
        PRESALES,
        SALES,
        DURINGEVENT,
        POSTEVENT
    }
    struct eventRevised {
        string eventName;
        address eventOrganizer;
        string location;
        string company;
        uint256 numTickets;
        uint256 resaleCeiling;
        uint256 maxTicketsPerAddress;
        uint256 commissionFee;
        uint256 eventDate;
    }

    mapping(uint256 => eventRevised) public events ;
    uint256 public numEvents = 0;

    function addEvent(
        string memory eventName, 
        address eventOrganizer,
        string memory location,
        string memory company,
        uint256 numTickets,
        uint256 resaleCeiling,
        uint256 maxTicketsPerAddress,
        uint256 commissionFee,
        uint256 eventDate
    ) public returns(uint256) {
        eventRevised memory newEventRevised = eventRevised(
            eventName,
            eventOrganizer,
            location,
            company,
            numTickets,
            resaleCeiling,
            maxTicketsPerAddress,
            commissionFee,
            eventDate
        );

        uint256 newEventId = numEvents++;
        events[newEventId] = newEventRevised;
        return newEventId;
    }


}
